import './App.css';
import axios from "axios";
import {useState} from "react";

function App() {
    const [hello, setHello] = useState('');
    return (
        <div className="App">

            useEffect(() => {
            axios.get('/api/test')
                .then((res) => {
                    setHello(res.data);
                })
        }, []);
            <div className="App">
                백엔드 데이터 : {hello}
            </div>

        </div>
    );
}

export default App;
